import React from 'react';

import {
  Route,
  Link,
  Switch
} from 'react-router-dom';

import About from './components/About';
import Messages from './components/Messages';

const Home = () => (
	<div className="App">
		<ul>
	  <li> <Link to="/">Home</Link> </li>
		<li> <Link to="/components/messages">Messages</Link> </li>
		<li> <Link to="/components/about">About</Link> </li>
	</ul>

	<div className="App-intro">
		<Switch>
		<Route exact path="/components/home" component={Home}/>
		<Route exact path="/components/messages" component={Messages}/>
		<Route exact path="/components/about" component={About}/>
		<Route component={Home}/>
		</Switch>
	</div>
</div>
);

export default Home;
